import React from 'react'; //lezim ay fichier .js niktbou aalih star hedha.
import ReactDOM, { render } from 'react-dom'; //library mokhtassa bel affichage coté navigateur web.



function App(){
    return (
    <div style={{color: "black"}}>

        <h1>Design is my life.</h1>
        <p>Graphic and web design are far more than a job for me.</p>
        <ul>
            <li>Facebook</li>
            <li>Youtube</li>
            <li>Instagram</li>
        </ul>

    </div>
    );
}

ReactDOM.render(<App/>,document.getElementById('root'));
